function initNewsForm() {
    var form = $("#form-newsletter");

    $(form).on("submit", function (eSubmit) {
      eSubmit.preventDefault();

      $(form).find("button[data-type='submit']").addClass("sending");
      setTimeout(function () {
        $(form).find("button[data-type='submit']").removeClass("sending").addClass("thanks");
      }, 3000);
      setTimeout(function () {
        $(form).find("button[data-type='submit']").removeClass("thanks");
      }, 4000);

    });
  }

  $(function () { initNewsForm(); });
